import React, { Component } from 'react';
import './style.css'
class Header  extends Component {
    render() { 
    return (
    <>
        <div>
        <div className="logo">
            <h3>Its Logo</h3>
        </div>
        <div className="nav-menu">
        <div className="nav-menu">Menu 1</div>
        <div className="nav-menu">Menu 2</div>
        <div className="nav-menu">Menu 3</div>
        <div className="nav-menu">Menu 4</div>
        <div className="nav-menu">Menu 5</div>
        </div>
        </div>
    </>
    );
    }
}
export default Header;
